    "use strict";
    function loadEWD(){
        try{
            top.ewd.mainSVG = new top.SVG.Diagram(document.rootElement);
            top.ewd.mainSVG.setViewBox();
            top.ewd.mainSVG.initDiagram();
            top.onResize();
            top.ewd.mainSVG.layout(top.ewd.mainSVG.CTM());
            if(top.ewd.initial_node === null)
                top.ewd.setTabs(0, true);
            else{
                top.ewd.mainSVG.activateNode(top.ewd.initial_node, true);
                top.ewd.mainSVG.center();
            }
            top.g_layout.options.view_map.Diagram.complete();
        }
        catch(ex){
            if(window.console)
                console.log("loadEWD: " + ex.message + "[" + ex.number + "]");
        }
    }
//
